  constexpr BitBoard rook(BitBoard all, BitBoard pos) {
    size_t id = bit::specLog2(pos);
    BitBoard row = rowTableRook[rowBoundsRook[id] +
      ((rowMovesRook[id] & all) * rowMagicRook[id] >> rowShiftRook[id])];
    BitBoard colomn = colomnTableRook[colomnBoundsRook[id] +
      ((colomnMovesRook[id] & all) * colomnMagicRook[id] >> colomnShiftRook[id])];
    return row | colomn;
  }
