  constexpr BitBoard rook(BitBoard all, BitBoard pos) {
    size_t id = bit::specLog2(pos);
    return tableRook[boundsRook[id] + 
      ((attacksRook[id] & all) * magicRook[id] >> shiftRook[id])];
  }
