namespace chess::attack {
  constexpr BitBoard byCode(
    const BitBoard& all,
    const BitBoard& pos,
    std::integral_constant<int, char2Code('R')>
  ) {
    return rook(all, pos); 
  }

  constexpr BitBoard byCode(
    const BitBoard& all,
    const BitBoard& pos,
    std::integral_constant<int, char2Code('r')>
  ) {
    return rook(all, pos); 
  }
} // namespace chess::attack


